import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Layout from "./Component_Day15/Layout";
import Home from "./Component_Day15/Home";
import Blogs from "./Component_Day15/Blogs";
import Contact from "./Component_Day15/Contact";
import NoPage from "./Component_Day15/NoPage";

export default function Menu() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          <Route path="blogs" element={<Blogs />} />
          <Route path="contact" element={<Contact />} />
          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
